# r
wd_te_file = 'wd_te.npy'
wd_tr_file = 'wd_tr.npy'
wd_va_file = 'wd_va.npy'

# w
wd_te_filter_file = 'wd_te_filter.npy'
wd_tr_filter_file = 'wd_tr_filter.npy'
wd_va_filter_file = 'wd_va_filter.npy'


def filter_d(read_file, write_file):
    lens_dict = dict()
    ids_not = [1025743, 1226448, 54111, 460600, 834740,
               920327, 995362, 1033823, 816903, 520477]
    wd_te = np.load(read_dir + read_file)
    wd_te_filter = []
    for sam in wd_te:
        wds = list(filter(lambda x: x not in ids_not, sam))
        lens = len(wds)
        if lens not in lens_dict.keys():
            lens_dict[lens] = 1
        else:
            lens_dict[lens] = lens_dict[lens] + 1
        wd_te_filter.append(wds)
    np.save(read_dir + write_file, wd_te_filter)
    print('save to ', read_dir + write_file)
    sor = sorted(lens_dict.items(), key=lambda x:x[1], reverse=True)
    print(sor)


if __name__ == '__main__':
    filter_d(wd_te_file, wd_te_filter_file)
    filter_d(wd_tr_file, wd_tr_filter_file)
    filter_d(wd_va_file, wd_va_filter_file)

